import './App.css';
import { Navbar, About, Projects} from './components'
import {Footer, Header, Project} from './containers'

function App() {
  return (
    <div className="App">
      <div className="gradient__bg">
        <Navbar />  
        <Header />
      </div>
      <Project/>
      <Footer/>
    </div>
  );
}

export default App;
